webpackJsonp([0xa66b96fba949],{8372:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Tee Time For Two",date:"12 Aug 2017",slug:"/2017-08-12-tee-time-for-two/",tags:"Y2017"},html:"<p>My gmail address is fairly generic, and apparently there are other people who would like to be PapaScott but can't. So I get a fair amount of mail intended for other PapaScotts, including:</p>\n<ul>\n<li>confirmation for my tee time at a golf club in Pennsylvania</li>\n<li>notice of automatic deposit of my salary from the State of Tennessee</li>\n<li>my reservation for one week at a mobile home park in Georgia</li>\n<li>advertising from a car dealer in Argentina</li>\n<li>an appeal in French to donate (or sell, I can't tell) my blood plasma to a clinic in Paris</li>\n<li>invitation of regular lunches of ex-military folks in Tennessee</li>\n<li>regular notices of transactions (with scans of receipts) from my Well Fargo bank account in Georgia</li>\n</ul>\n<p>And I'm not even looking in my spam folder. I have enough keeping track of my own schedule without having to worry items for total strangers!</p>"},next:{fields:{title:"Travis CI",date:"23 Jul 2017",slug:"/2017-07-23-travis-ci/"}},previous:{fields:{title:"Katchi",date:"04 Jan 2018",slug:"/2018-01-04-katchi/"}}},{node:{fields:{title:"Travis CI",date:"23 Jul 2017",slug:"/2017-07-23-travis-ci/",tags:"Y2017"},html:'<p>So, yeah, I figured out how to use <a href="https://travis-ci.org/" title="Travis CI - Test and Deploy Your Code with Confidence">Travis CI</a> to <a href="http://pauldambra.github.io/using-travis-to-build-jekyll.html" title="Using Travis CI to build a Jekyll site">build my Jekyll blog</a> and push it to <a href="https://pages.github.com/" title="Websites for you and your projects">GitHub Pages</a>, and figured that I would actually write something for it to build rather than just fiddle with scripts and yaml files in the background.</p>'},next:{fields:{title:"The Future Part 2",date:"26 Feb 2017",slug:"/2017-02-26-the-future-part-2/"}},previous:{fields:{title:"Tee Time For Two",date:"12 Aug 2017",slug:"/2017-08-12-tee-time-for-two/"}}},{node:{fields:{title:"The Future Part 2",date:"26 Feb 2017",slug:"/2017-02-26-the-future-part-2/",tags:"Y2017"},html:'<ul class="photo-gallery">\n  {% for image in page.images%}\n    <li>\n      <a href="{{ image.image_path }}" data-lightbox="1" title="{{ image.title }}">\n        <img src="{{ image.image_path }}" alt="{{ image.title }}">\n      </a>\n    </li>\n  {% endfor %}\n</ul>\n<p>Last fall we converted our restaurant in Dibbersen into a [Restaurant of the Future]({% post_url 2016-11-06-the-future-is-now %}). Now we\'ve remodeled our Hamburg, Winsener Straße restaurant so now we have doubled the future!</p>\n<p>The lobby here has a more urban theme that fits our gritty part of Hamburg. I was worried it would be too dark, but the spots of color make it look brighter live than it appears in the photos.</p>\n<p>It of course has all the innovations in Dibbersen, plus we now serve "Barista Quality" coffee at the front counter, meaning that the espresso drinks are made with the <a href="http://www.wmf-espresso.de/index_en.php#coffee-machine-section">portafilter machine</a> in McCafé.</p>\n<p>With all this future we need to take time to catch our breaths. Our 3rd drive-thru restaurant on the Autobahn A1 at Rade will join the future in early 2018.</p>'},next:{fields:{title:"Song of the Day: I Can't Drive 55",date:"09 Feb 2017",slug:"/2017-02-09-song-of-the-day-i-cant-drive-55/"}},previous:{fields:{title:"Travis CI",date:"23 Jul 2017",slug:"/2017-07-23-travis-ci/"}}}],pathPrefix:"",first:!1,last:!1,index:3,pageCount:1101}}}});
